The copula for Perceived Response Efficacy achieves a significant p-value in some constellations (p < 0.1). Further, adding the single copula increases the Perceived Response Efficacy coefficient by about 0.06. Both of this indicates that Perceived Response Efficacy might be endogenous. There is nothing pointing to endogeneity in any of the other predictors.
The copula will be integrated in the final model to improve the model.
